import React from "react";
import {NavLink} from "react-router-dom";

const Welcome: React.FC = () => {

  return (
    <>
      <h1>Welcome on products page.</h1>
      <NavLink to={"/login"}>Log in</NavLink>
      <NavLink to={"/signin"}>Sign in</NavLink>
    </>
  )
}

export default Welcome;
